    const nome = this.props.Nome
    const funcao = this.props.funcao

    return (
      <Container>
        <div class="ui card">

          <div class="ui mediun image" size='small'><img src="https://i.pinimg.com/564x/eb/ca/a1/ebcaa107e84dbaa6f50392bb7050c3b8.jpg" />
          </div>
          <div class="content">
            <div class="header">João Marcos</div>
            <div class="meta">Financeiro</div>

            <div class="description">Horas Mes: 85h.</div>
          </div><div class="extra content"><i aria-hidden="true" class="user icon">
